    geo_json_8a6f398b1fa727dfe6eba6e53bdb7254.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["DATE", "LATITUDE", "LONGITUDE", "POD_TYPE", "POD_TAG", "COUNT", "SOURCE", "DATETIME", "DOY", "WOY", "MONTH", "YEAR", "YEAR_WEEK", "YEAR_MONTH", "STAT_WEEK_SUNDAY", "H3_CELL", "SIGHTING", "CELL_RATIO_smooth_Scaled", "PREDICTION"];
    let aliases = ["DATE", "LATITUDE", "LONGITUDE", "POD_TYPE", "POD_TAG", "COUNT", "SOURCE", "DATETIME", "DOY", "WOY", "MONTH", "YEAR", "YEAR_WEEK", "YEAR_MONTH", "STAT_WEEK_SUNDAY", "H3_CELL", "SIGHTING", "CELL_RATIO_smooth_Scaled", "PREDICTION"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
